import MenuItem from '@mui/material/MenuItem';
import Select, { SelectChangeEvent } from '@mui/material/Select';
import { SyntheticEvent, useState } from 'react';
import { Entry, FormTypes } from '../../types';
import Common from './Common';
import HealthCheck from './HealthCheck';
import Hospital from './Hospital';
import OccupationalHealthcare from './OccupationalHealthcare';


const PatientForm =()=>{

      const [type,setType]=useState('')
      const [entry,setEntry]=useState<Entry>()

  const handleChange = (event: SelectChangeEvent) => {
    setType(event.target.value as string);
  };

  const submitEntry=(event:SyntheticEvent)=>{

    event.preventDefault();

  }

  console.log("The type is ",type)
  return(
    <div style={{border:"2px dashed black",marginTop:"1rem",marginBottom:"1rem",padding:"2rem"}}>

      <form onSubmit={submitEntry}>

       <label>Type : </label>
         <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={type}
          label="Age"
          onChange={handleChange}
        >
          {
          Object.values(FormTypes)
          .map( type =>  <MenuItem key={type}  value={type}>{type}</MenuItem>)
          }

        </Select>
        <br/>
        <Common/>
        {type==="HealthCheck"?<HealthCheck/>:""}
        {type==="OccupationalHealthcare"?<OccupationalHealthcare/>:""}
        {type==="Hospital"?<Hospital/>:""}
      </form>
    </div>
  )

}

export default PatientForm
